#include "MFZAvatarGenMdlFemaleVerts.hpp"

using namespace mfz_avatar_gen;

// Class methods

mdl_female_verts::mdl_female_verts(void) : m_female_avg_vertices(c_female_vertices, c_female_vertices + sizeof(c_female_vertices) / sizeof(double)),
                                           m_female_mvn_mu(c_female_mvn_mu, c_female_mvn_mu + sizeof(c_female_mvn_mu) / sizeof(double)),
                                           m_female_ranges(N_MU, std::vector<double>(2, 0)),
                                           m_female_cov(N_MU, std::vector<double>(N_MU, 0)),
                                           m_female_sv(N_VERTS_3, std::vector<double>(N_MU, 0)),
                                           m_female_SkV(N_SKELS, std::vector<double>(3, 0))
{
    // Ranges
    for (unsigned int i = 0; i < N_MU; ++i) {
        for (unsigned int j = 0; j < 2; ++j) {
            m_female_ranges[i][j] = c_female_ranges[i][j];
        }
    }
    // Cov
    for (unsigned int i = 0; i < N_MU; ++i) {
        for (unsigned int j = 0; j < N_MU; ++j) {
            m_female_cov[i][j] = c_female_cov[i][j];
        }
    }
    // Sv
    for (unsigned int i = 0; i < N_VERTS_3; ++i) {
        for (unsigned int j = 0; j < N_MU; ++j) {
            m_female_sv[i][j] = c_female_shape_vectors_transposed[i][j];
        }
    }
    // SkV
    for (unsigned int i = 0; i < N_SKELS; ++i) {
        for (unsigned int j = 0; j < 3; ++j) {
            m_female_SkV[i][j] = c_female_sym_skel[i][j];
        }
    }
}

std::vector<double> &mdl_female_verts::getAvgVerts(void) const {
    return const_cast<std::vector<double>&>(m_female_avg_vertices);
}
std::vector<double> &mdl_female_verts::getMvnMu(void) const {
    return const_cast<std::vector<double>&>(m_female_mvn_mu);
}
std::vector< std::vector<double> > &mdl_female_verts::getCov(void) const {
    return const_cast<std::vector< std::vector<double> >&>(m_female_cov);
}
std::vector< std::vector<double> > &mdl_female_verts::getRanges(void) const {
    return const_cast<std::vector< std::vector<double> >&>(m_female_ranges);
}
std::vector< std::vector<double> > &mdl_female_verts::getSv(void) const {
    return const_cast<std::vector< std::vector<double> >&>(m_female_sv);
}
std::vector< std::vector<double> > &mdl_female_verts::getSkV(void) const {
    return const_cast<std::vector< std::vector<double> >&>(m_female_SkV);
}

